import React from "react";
import Header from "../components/Header";
import DescriptionForm from "../components/DescriptionForm";
import PositionsDescription from "../components/PositionsDescription";

type MyProps = {
    handlePositionChange: any,
    positionState: any,
    positionsList: any,
   };

class Positions extends React.Component<MyProps>{
    render(): React.ReactNode {
        const { handlePositionChange, positionState, positionsList } = this.props;
        return(
            <div>
                <Header linkTo="/" linkTitle="Funcionários" headerTitle="Descrição dos cargos da empresa" />
                <DescriptionForm positionState={positionState} handlePositionChange={handlePositionChange} />

                  <div className="px-5">
                    {positionsList.map((position: any) => (
                        <PositionsDescription positionName={position.positionName} positionDesc="Atua na área de design da aplicação webAtua na área" />
                    ))}
                  </div>
            </div>
        );
    }
}

export default Positions;
